<template>
    <view>
        <nut-tabbar
            v-model:visible="selected"
            :bottom="true"
            unactive-color="#7D7E80"
            active-color="#7D7E80"
            @tab-switch="tabSwitch"
        >
            <nut-tabbar-item
                v-for="(item,index) in items"
                :key="index"
                :tab-title="item.title"
                :img="item.img"
                :active-img="item.activeImg"
            >
            </nut-tabbar-item>
        </nut-tabbar>
    </view>
</template>
<script lang="ts" setup>

import { onMounted,ref,computed } from 'vue'
import Taro from '@tarojs/taro'
import { useTabbarStore } from '../store'
import "@nutui/nutui-taro/dist/style.css";
import { useI18n } from "vue-i18n";

const { t } = useI18n();
const tabbarStore=useTabbarStore();
const selected = computed(() => tabbarStore.getSelected)

const items=ref([
        {
            title: t('tabbar.home'),
            img:'data:image/png;base64,',
            activeImg:'data:image/png;base64,',
            url:'/pages/home/index/index'
        },
        {
            title:t('tabbar.meeting'),
            img:'data:image/png;base64,',
            activeImg:'data:image/png;base64,',
            url:'/pages/meeting/index/index'
        },
        {
            title:t('tabbar.shop'),
            img:'data:image/png;base64,',
            activeImg:'data:image/png;base64,',
            url:'/pages/shop/index/index'
        },
        {
            title:t('tabbar.my'),
            img:'data:image/png;base64,',
            activeImg:'data:image/png;base64,',
            url:'/pages/my/index/index'
        }
    ])

onMounted(()=>{

})

const tabSwitch=(item,index)=>{
    let tabItem=items.value[index]
    tabbarStore.setSelected(index)
    Taro.switchTab({ url:tabItem.url })
}

</script>
